import React from 'react'

const Datatable = (props) => {
    let Data = props.data;
    console.log(Data,Data.length,Data["productName"]);
    // let Total;
    // for (let i = 0; i < Data.length; i++) {
    //     console.log
    //     let unitPrice = parseInt(Data[i].unitPrice);
    //     let quantitySold = parseFloat(Data[i].soldQuantity);
    //     Total += quantitySold * unitPrice;
    // }
    // Total = Total.toFixed(2);
    
  return (
    <table cellPadding={0} cellSpacing={0}>
      <thead>
        <tr>
          <th>Product</th>
          <th>Revenue</th>
        </tr>
      </thead>
      <tbody>
        {props.data.map((prop) => (
          <tr>
            <td>{prop.productName}</td>
            <td>{(parseFloat(prop.unitPrice,2) * parseFloat(prop.soldQuantity,2)).toFixed(2)}</td>
          </tr>
        ))}
      </tbody>
      <tfoot>
        <tr>
          <td>Total</td>
          <td></td>
        </tr>
      </tfoot>
    </table>
  )
}

export default Datatable
